import React from 'react';
import './Cards.css';

import './HeroSection.css';
import './Aboutus.css'
import kal from "./kalbw.jpeg"


function Who() {
  return (
    <div class="container">
    <img src={{kal}} alt="Avatar" />
    <p><span>Chris Fox.</span> CEO at Mighty Schools.</p>
    <p>John Doe saved us from a web disaster.</p>
  </div>


  );
}

export default Who;
